window.bookSummaryJSON = "<p>The year is 2522. Anna is a Remnant - a secret Christian in a world that has banned any form of religion. She is also an astro-geologist, working with her robot named Z, for the Planetary Science Commission.</p> <p>The PSC has worked for 200 years to find alien life on another planet, and finally, after two centuries, a primitive lifeform has been discovered. Faced with the reality of evolved primitives on a forested moon, Anna begins to question all she has ever believed.</p> <p>Anna and Z travel to the newly discovered moon in search of answers, but a terrible accident leaves them stranded. Faced with dangerous natives and unfamiliar surroundings, Anna and Z stumble upon a conspiracy that has universal implications.</p> <p><b>Will Anna discover the truth about the moon and its inhabitants?&nbsp;Can God still move within a culture that has abandoned him?</b></p>"; 
